import { useFetch } from '../../hooks/useFetch'
//styles
import './home.css';

// Components
import Recipt from '../../components/RecipeList';

const Home = () => {
    const { data, error, isPending } = useFetch('https://jsonplaceholder.typicode.com/users')
    
    
    return (
        <div className='home-wrapper'>
            {error && <p>couldn't load {error}</p>}
            {isPending && <h1>Loadding</h1>}
            {data && <Recipt data={data}/>}
        </div>
    );
}

export default Home;
